import React, { Component } from 'react';
import './style';

class OrderItem extends Component {
    render() {
        return (
            <div className='orderItem'>
                <div className='orderItem_picContainer'>
                    <img className='orderItem-pic'/>
                </div>
                <div className='orderItem_content'>
                    <div className='orderItem_product'>productname</div>
                    <div className='orderItem_shop'>productowner</div>
                    <div className='orderItem_detail'>
                        <div className='orderItem_price'>13</div>
                        <div>
                            <button className='orderItem_btn orderItem_btn--red'>comment</button>
                        </div>
                    </div>
                </div>
            </div>
        );
    }
}

export default OrderItem;
